import React from 'react';
import { Route } from 'react-router-dom';
import { Link } from 'react-router-dom';

import './App.css';
import HomePage from './pages/homepage/hompage.component';

const HatsPage = () =>(
  <div>
    <h1>Hats Page</h1>
  </div>
)

function App() {
  return (
    <div >
      <Routes>
      <Route path="/" element={<HomePage />} />

    </Routes>
    </div>
  );
}

export default App;
